window.onload=()=>{$(".language-item").click()};const showLanguage=e=>{Array.from($(".language-section").children).forEach(e=>{e.style.display!=="none"&&(e.style.display="none")}),$("#"+e).style.display="block"},showTimeline=e=>{let t=$("#"+e);t.style.maxHeight==="0px"?t.style.maxHeight=t.scrollHeight+"px":t.style.maxHeight="0px"}